// /components/SkillsSection.js
import React from "react";
import ListGroup from "../ListGroup";

function SkillsSection() {
  const languages = [
    "Python", 
    "C/C++", 
    "Java", 
    "C#", 
    "SQL", 
    "JavaScript", 
    "Verilog", 
    "Assembly", 
    "YAML", 
    "XML"
  ];

  const frameworks = [
    "NumPy", 
    "LangChain", 
    "Hugging Face", 
    "PyTorch", 
    "Pandas", 
    "Matplotlib", 
    "Spark", 
    "TensorFlow"
  ];

  const devToolkit = [
    "Azure", 
    "Git", 
    "Azure Data Studio", 
    "Linux (Shell Scripting)", 
    "MATLAB"
  ];

  return (
    <section className="container my-4">
      <div className="row">
        <div className="col-md-4">
          <ListGroup 
            heading="Languages" 
            items={languages} 
            onSelectItem={(item) => console.log(item)} 
          />
        </div>
        <div className="col-md-4">
          <ListGroup 
            heading="Frameworks" 
            items={frameworks} 
            onSelectItem={(item) => console.log(item)} 
          />
        </div>
        <div className="col-md-4">
          <ListGroup 
            heading="Development Toolkit" 
            items={devToolkit} 
            onSelectItem={(item) => console.log(item)} 
          />
        </div>
      </div>
    </section>
  );
}

export default SkillsSection;
